import React from 'react';
import './SmallCard.scss'
import smallCardImg from '../../assets/small-card-img.png'
const SmallCard = () => {
    return (
        <div className="small-card">
            <img src={smallCardImg}/>
            <span className="small-card__content">
                <h3 className="small-card__title">Imprezy okolicznościowe</h3>
                <p className="small-card__para">Przed Tobą chrzest , Jubileusz lub rocznica ślubu? Każde przyjęcie przygotujemy jak Twoje ostatnie! </p>
            </span>

        </div>
    );
};

export default SmallCard;
